x/e-mail se va considera ca fiind&nbsp;trimis n prima zi lucrtoare dup cea n care a fost expediat;&nbsp;</p><p>9.7. Data la care se va considera primit o notificare/adresa/cerere/comunicare este data menionat&nbsp;n raportul de confirmare.&nbsp;</p><p><strong>Art. 10. Litigii&nbsp;</strong></p><p>10.1. Prezentul Contract este guvernat de legea romn.&nbsp;</p><p>10.2. Orice nenelegere rezultat din valabilitatea, executarea i interpretarea prezentului Contract&nbsp;va fi soluionat n mod amiabil. Cnd aceasta nu este posibil, litigiul va fi depus spre soluionare&nbsp;instantelor competente de la sediul Beneficiarului.&nbsp;</p><p><strong>Art.11. CLAUZA DE CONFIDENIALITATE SI DE PROTECTIE A DATELOR PERSONALE (GDPR).&nbsp;</strong></p><p>Fiecare Parte se oblig s nu divulge terelor persoane, fr acordul prealabil exprimat n scris al&nbsp;celeilalte Pari, informaia obinut n procesul executrii prezentului Contract, precum i s o&nbsp;utilizeze numai n scopurile executrii prezentului Contract. Obligaia nu se aplic informaiei: a.&nbsp;divulgate la solicitarea unor autoritati publice cu atributii, fcut n conformitate cu legislaia n&nbsp;vigoare; b. care este de domeniul public la momentul divulgrii; c. divulgate n cadrul unui proces&nbsp;judiciar ntre Pari privind acest Contract; d. divulgate acionarilor Prii, persoanelor cu funcii de&nbsp;rspundere, salariailor, reprezentanilor, agenilor, consultanilor, auditorilor, cedenilor,&nbsp;</p><p>P a g e 5 | 6&nbsp;</p><p>succesorilor i/sau ntreprinderilor afiliate ale Parii care sunt implicate n executarea prezentului&nbsp;Contract, referitor la care Partea va trebui:- s limiteze divulgarea informaiei numai ctre cei ce au&nbsp;nevoie de ea pentru ndeplinirea obligaiilor sale fa de Parte;- sa asigure folosirea informaiei&nbsp;exclusiv in scopurile nemijlocit legate de ceea pentru ce informaia este divulgata;- sa informeze toate&nbsp;aceste persoane privind obligaia lor de a pstra confidenialitatea informaiei n modul stabilit de prezentul Contract.&nbsp;</p><p>Sunt considerate informaii confideniale i fac obiectul prezentelor clauze, datele de identificare&nbsp;(nume, semntur, serie i numr CI etc.) ale reprezentanilor Prilor, care se vor regsi pe&nbsp;documentele emise de (schimbate ntre) Pari n perioada derulrii Contractului i care nu sunt de&nbsp;domeniul public la momentul divulgrii. Prelucrarea de ctre Pri a datelor cu caracter personal ale&nbsp;persoanelor vizate mai sus se va realiza cu respectarea principiilor i drepturilor acestora care decurg&nbsp;din punerea n aplicare a REGULAMENTUL (UE) 2016/679 AL PARLAMENTULUI EUROPEAN I AL&nbsp;CONSILIULUI privind protecia persoanelor fizice n ceea ce privete prelucrarea datelor cu caracter&nbsp;personal  GDPR. n spiritul GDPR, Prile au urmtoarele drepturi de acces la datele personale ale&nbsp;angajailor/reprezentanilor proprii, operate de cealalt Parte:a) Dreptul de acces la date; b) reptul&nbsp;la rectificarea datelor; c) Dreptul la tergerea datelor; d)Dreptul la restricionarea prelucrrii; e)&nbsp;Dreptul la portabilitatea datelor; f) Dreptul de opoziie la prelucrarea datelor; g) Dreptul de a nu fi&nbsp;supus unor decizii automatizate, inclusiv profilarea; h) Dreptul la notificarea destinatarilor privind&nbsp;rectificarea, tergerea ori restricionarea datelor cu caracter personal.&nbsp;</p><p>Conform legislaiei naionale n vigoare n domeniu, datele personale solicitate de beneficiar sunt&nbsp;necesare pentru buna derulare a Contractului (completarea facturilor, documentelor contabile) i nu&nbsp;vor fi folosite n alte scopuri.&nbsp;</p><p>Datele personale obinute sunt procesate n bazele de date i pe serverele Niro Investment S.A. (societate afiliata), pe ntreaga durat a raporturilor contractuale i ulterior, conform politicilor&nbsp;interne, pe durata necesar ndeplinirii obligaiilor legale ce ii revin. Respectarea cerinelor legale&nbsp;aplicabile sunt permanent monitorizate, inclusiv prin Responsabilul de protecie a datelor cu caracter&nbsp;personal ce poate fi contactat la dpo@nirogroup.ro. Reclamaiile privind posibila nclcare a&nbsp;drepturilor privind prelucrarea datelor cu caracter personal pot fi adresate Autoritii Naionale de&nbsp;Supraveghere a Prelucrrii Datelor cu Caracter Personal la adresa www.dataprotection.ro.&nbsp;</p><p>Oricare dintre Prile contractante se oblig, n termenii i condiiile prezentului Contract, s pstreze&nbsp;strict confideniale, pe durata Contractului i dup incetarea acestuia, toate datele i informaiile,&nbsp;divulgate n orice manier de ctre cealalt Parte, n executarea Contractului. Excepie de la prezenta&nbsp;obligaie sunt cazurile n care divulgarea este necesar pentru executarea Contractului i se face&nbsp;numai avand consimmntul scris, expres si prealabil al celeilalte Pri sau daca divulgarea este&nbsp;solicitat, n mod legal, de ctre autoritile de drept.&nbsp;</p><p>n cazul n care oricare dintre Pri va nclca obligaia de confidenialitate, aceasta va fi obligat la&nbsp;plata de daune-interese n favoarea Prii prejudiciate.&nbsp;</p><p><strong>Art.12. Cesiunea Contractului&nbsp;</strong></p><p>12.1. Prezentul Contract are caracter <em>intuitu personae </em>in privinta Prestatorului; acesta nu poate&nbsp;transmite unei tere persoane, total sau parial, drepturile i obligaiile ce ii revin prin prezentul&nbsp;Contract, dect dac a obinut acordul scris i prealabil al Beneficiarului, care acord trebuie transmis&nbsp;Prestatorului n termen de 5 (cinci) zile lucrtoare de la momentul primirii notificrii. n lipsa unui&nbsp;</p><p>P a g e 6 | 6&nbsp;</p><p>rspuns scris i expres exprimat n acest sens, se consider c Partea nu consimte la cesiunea&nbsp;Contractului i aceasta nu poate avea loc.&nbsp;</p><p><strong>Art. 13. Clauze finale&nbsp;</strong></p><p>13.1. Partile sunt de drept in intarziere in cazul neindeplinirii sau indeplinirii necorespunzatoare a&nbsp;oricareia din obligatiile ce le revin potrivit Contractului.&nbsp;</p><p>13.2. Reprezentanii Prilor declar c sunt pe deplin mputernicii pentru semnarea Contractului&nbsp;i c Partea pe care o reprezint este valabil nregistrat i are deplin capacitate pentru ncheierea&nbsp;prezentului acord i pentru exercitarea drepturilor i executarea obligaiilor prevzute prin acesta. 13.3. Partile declara ca toate prevederile Contractului au fost negociate cu bunacredinta, le-au&nbsp;citit, si le-au asumat si sunt de acord cu acestea asa cum sunt consemnate prin prezentul inscris.&nbsp;13.4. Ambele Parti declara ca isi asuma, pe toata durata contractuala, riscul schimbarii&nbsp;imprejurarilor (de orice natura- inclusiv, dar fara a se limita la, cele politice, economice, comerciale si&nbsp;financiare) existente la data incheierii Contractului, cu respectarea prevederilor Art. 1271 Cod civil.&nbsp;13.5. Prezentul Contract este supus legii romane si interpretat in conformitate cu prevederile&nbsp;acesteia. Orice litigiu, controversa sau pretentie a Partilor, decurgand din sau in legatura cu prezentul&nbsp;Contract si care nu a fost solutionata de Parti in mod amiabil, va fi supusa, spre solutionare, instantelor&nbsp;judecatoresti competente din Bucuresti.&nbsp;</p><p>13.6. Contract poate fi modificat exclusiv prin incheierea de acte aditionale.&nbsp;13.7. Prevederile contractuale sunt integral obligatorii pentru Partile semnatare si succesorii lor in&nbsp;drepturi si obligatii.&nbsp;</p><p>Prezentul Contract a fost incheiat in 2 (dou) exemplare astazi, 01.02.2024, cate un exemplar pentru&nbsp;fiecare Parte.&nbsp;</p><p>Beneficiar, Prestator,&nbsp;</p><p><strong>NIRO INVESTMENT S.A. SOFTHUB AG S.R.L. </strong>Director General, Administrator,&nbsp;</p><p><strong>Mihaela Istrate Razvan Mihai Mustata</strong>&nbsp;</p>	5
