erente unor elemente pe care legislaia romn le consider a fi de natur a reflecta&nbsp;natura dependent a unei activiti economice.&nbsp;</p><p>1.2. Pe durata prezentului Contract, Prestatorul va furniza Serviciile prevzute n Contract.&nbsp;</p><p>1.3. Prestatorul i va suporta propriile sale cheltuieli n interesul desfurrii activitii, precum orice&nbsp;tipuri de cheltuieli aferente:&nbsp;</p><p>a) deplasrii de la/la sediul Prilor sau al altor persoane fizice/juridice,&nbsp;</p><p>b) timpului de odihn, n care Parile nu-i execut prestaiile unele fa de altele, c) imposibilitii temporare de realizare a prestaiilor contractuale ca urmare a unui concediu&nbsp;medical sau oricror cauze asementoare,&nbsp;</p><p>d) oricror altor situaii de natura celor prevzute la alin. 1-3.&nbsp;</p><p>1.4. Serviciile vor fi prestate de Prestator din orice locatie adecvata, folosind baza materiala a&nbsp;Prestatorului (statie de lucru, conexiune internet, software specializat de dezvoltare, software&nbsp;specializat de testare etc.), iar livrabilele vor fi furnizate electronic Beneficiarului (prin email sau&nbsp;ncrcare pe serverele specializate ale Beneficiarului).&nbsp;</p><p><strong>Art. 2. Obiectul Contractului&nbsp;</strong></p><p>2.1. Prestatorul se obliga sa furnizeze, la solicitarea Beneficiarului si in beneficiul acestuia, servicii de&nbsp;integrare a sistemului <strong>Charisma </strong>cu platforma<strong>/</strong>aplicaia <strong>CEC Bank</strong>, pentru export extrase de cont i&nbsp;efectuare pli n sistem internet banking (<strong>Serviciile</strong>).</p><p>P a g e 2 | 6&nbsp;</p><p><strong>Art. 3. Obligatiile Prestatorului&nbsp;</strong></p><p>Prestatorul isi asuma urmatoarele obligatii:&nbsp;</p><p>a) sa presteze Serviciile catre Beneficiar conform solicitarilor acestuia si sa asigure&nbsp;finalizarea corespunzatoare si in timp util a acestora, la standardele de calitate cerute si&nbsp;in termenele agreate;&nbsp;</p><p>b) sa furnizeze Serviciile spre satisfactia rezonabila a