calitate, deviz care va fi furnizat de catre Prestator Beneficiarului&nbsp;la data emiterii facturii fiscale.&nbsp;</p><p>5.3. Plata remuneraiei datorate Prestatorului se va face la finalizare Serviciilor, n termen de&nbsp;maximum 10 (zece) zile lucrtoare de la data acceptrii la plat a facturii fiscale emise de Prestator.&nbsp;</p><p>5.4. Plata se efectueaza n contul Prestatorului cod RO17INGB0000999906676339 deschis la ING&nbsp;BANK NV pe numele Prestatorului.&nbsp;</p><p>P a g e 3 | 6&nbsp;</p><p><strong>Art.6. Durata Contractului&nbsp;</strong></p><p>6.1. Contractul i produce efectele de la data semnrii prezentului inscris de ctre ambele Pri i&nbsp;este valabil pn la ndeplinirea tuturor obligaiilor contractuale.&nbsp;</p><p>6.2. Prestatorul se angajeaz ca, pn la data de <strong>20.02.2024</strong>, s finalizeze Serviciile la care se&nbsp;angajeaz prin prezentul Contract (<strong>Termen de finalizare</strong>)&nbsp;</p><p>6.3. Termenul de finalizare este ferm.&nbsp;</p><p>6.4. In cazul in care Prestatorul nu isi indeplineste corespunztor obligatiile asumate prin Contract,&nbsp;Beneficiarul este indreptatit sa perceapa penalitati de intarziere de 0,5% pe zi de intarziere, calculat&nbsp;din valoarea totala a Contractului. In cazul in care Beneficiarul nu onoreaza plata in termenii prevazui&nbsp;prin Contract, acesta are obligatia de a plati penalitati de intarziere de 0,5% pe zi de intarziere,&nbsp;calculat din suma datorat. Cuantumul penalitilor poate depi valoarea la care ele au fost calculate.&nbsp;</p><p><strong>Art.7. ncetarea Contractului&nbsp;</strong></p><p>7.1. Prezentul Contract nceteaz n oricare din urmtoarele modaliti:&nbsp;</p><p>(a) prin acordul scris al Prilor;&nbsp;</p><p>(b) prin ajungerea la termen i/sau ndeplinirea tuturor obligaiilor contractuale; (c) prin demararea procedurilor de faliment, dizolvare sau lichidare a oricreia dintre Pri; (d) n caz de fora major, n condiiile legii;&nbsp;</p><p>(e) prin denuntarea unilaterala a Contractului de catr