de catre Beneficiar, oricand, indiferent de motiv,&nbsp;transmitand Prestatorului o notificare prealabila cu minim 10 (zece) zile calendaristice nainte&nbsp;de data la care opereaz ncetarea Contractului;&nbsp;</p><p>(f) prin cesionarea de ctre Prestator a drepturile i obligaiilor sale prevzute prin Contract, fr&nbsp;acordul scris, expres i prealabil al Beneficiarului;&nbsp;</p><p>(g) prin rezilierea unilateral de ctre oricare dintre Pri, n baza unei notificri de reziliere&nbsp;transmis celeilalte Pri conform Art. 1.552 Codul Civil, n msura n care acesta nu&nbsp;ndeplinete sau ndeplinete n mod necorespunztor obligatiile sale i nu le remediaz n&nbsp;termenul indicat de catre cealalt Parte;&nbsp;</p><p>7.2. ncetarea Contractului nu va avea niciun efect asupra obligaiilor deja scadente ntre Pri la data&nbsp;survenirii acesteia.&nbsp;</p><p>7.3. Prestatorul se afla de drept in inatrziere odata cu implinirea Termenului de finalizare. 7.4. Decalarea termenelor de executie determina decalarea corespunzatoare a platilor.&nbsp;</p><p><strong>Art. 8. Forta majora&nbsp;</strong></p><p>8.1. Forta majora exonereaza de raspundere Partea care o invoca, dar numai in masura si pentru&nbsp;perioada in care Partea este impiedicata sau intarziata sa-si execute obligatia din pricina situatiei de&nbsp;forta majora. Partea care invoca forta majora va depune toate eforturile rezonabile pentru a reduce&nbsp;cat mai mult posibil efectele rezultand din forta majora.&nbsp;</p><p>8.2. Forta majora exonereaza de raspundere Partea care o invoca, in conditiile legii, daca o comunica&nbsp;in scris, celeilalte Parti in termen de 15 zile de la producere si o dovedeste printr-un certificat oficial,&nbsp;in termen de 15 de zile de la data invocarii ei.&nbsp;</p><p>8.3. Prin forta majora se inteleg toate evenimentele si/sau imprejurarile independente de vointa&nbsp;partii care invoca forta majora, imprevizibile si de neinlaturat si care, survenind dupa incheierea&nbsp;contractului, impiedica ori intirzie