sonal ce poate fi contactat la dpo@nirogroup.ro. Reclamaiile privind posibila nclcare a&nbsp;drepturilor privind prelucrarea datelor cu caracter personal pot fi adresate Autoritii Naionale de&nbsp;Supraveghere a Prelucrrii Datelor cu Caracter Personal la adresa www.dataprotection.ro.&nbsp;</p><p>Oricare dintre Prile contractante se oblig, n termenii i condiiile prezentului Contract, s pstreze&nbsp;strict confideniale, pe durata Contractului i dup incetarea acestuia, toate datele i informaiile,&nbsp;divulgate n orice manier de ctre cealalt Parte, n executarea Contractului. Excepie de la prezenta&nbsp;obligaie sunt cazurile n care divulgarea este necesar pentru executarea Contractului i se face&nbsp;numai avand consimmntul scris, expres si prealabil al celeilalte Pri sau daca divulgarea este&nbsp;solicitat, n mod legal, de ctre autoritile de drept.&nbsp;</p><p>n cazul n care oricare dintre Pri va nclca obligaia de confidenialitate, aceasta va fi obligat la&nbsp;plata de daune-interese n favoarea Prii prejudiciate.&nbsp;</p><p><strong>Art.12. Cesiunea Contractului&nbsp;</strong></p><p>12.1. Prezentul Contract are caracter <em>intuitu personae </em>in privinta Prestatorului; acesta nu poate&nbsp;transmite unei tere persoane, total sau parial, drepturile i obligaiile ce ii revin prin prezentul&nbsp;Contract, dect dac a obinut acordul scris i prealabil al Beneficiarului, care acord trebuie transmis&nbsp;Prestatorului n termen de 5 (cinci) zile lucrtoare de la momentul primirii notificrii. n lipsa unui&nbsp;</p><p>P a g e 6 | 6&nbsp;</p><p>rspuns scris i expres exprimat n acest sens, se consider c Partea nu consimte la cesiunea&nbsp;Contractului i aceasta nu poate avea loc.&nbsp;</p><p><strong>Art. 13. Clauze finale&nbsp;</strong></p><p>13.1. Partile sunt de drept in intarziere in cazul neindeplinirii sau indeplinirii necorespunzatoare a&nbsp;oricareia din obligatiile ce le revin potrivit Contractului.&nbsp;</p><p>13.2. Reprezentanii Prilor declar c sunt pe deplin mputerni