tul Contract.&nbsp;</p><p>Sunt considerate informaii confideniale i fac obiectul prezentelor clauze, datele de identificare&nbsp;(nume, semntur, serie i numr CI etc.) ale reprezentanilor Prilor, care se vor regsi pe&nbsp;documentele emise de (schimbate ntre) Pari n perioada derulrii Contractului i care nu sunt de&nbsp;domeniul public la momentul divulgrii. Prelucrarea de ctre Pri a datelor cu caracter personal ale&nbsp;persoanelor vizate mai sus se va realiza cu respectarea principiilor i drepturilor acestora care decurg&nbsp;din punerea n aplicare a REGULAMENTUL (UE) 2016/679 AL PARLAMENTULUI EUROPEAN I AL&nbsp;CONSILIULUI privind protecia persoanelor fizice n ceea ce privete prelucrarea datelor cu caracter&nbsp;personal  GDPR. n spiritul GDPR, Prile au urmtoarele drepturi de acces la datele personale ale&nbsp;angajailor/reprezentanilor proprii, operate de cealalt Parte:a) Dreptul de acces la date; b) reptul&nbsp;la rectificarea datelor; c) Dreptul la tergerea datelor; d)Dreptul la restricionarea prelucrrii; e)&nbsp;Dreptul la portabilitatea datelor; f) Dreptul de opoziie la prelucrarea datelor; g) Dreptul de a nu fi&nbsp;supus unor decizii automatizate, inclusiv profilarea; h) Dreptul la notificarea destinatarilor privind&nbsp;rectificarea, tergerea ori restricionarea datelor cu caracter personal.&nbsp;</p><p>Conform legislaiei naionale n vigoare n domeniu, datele personale solicitate de beneficiar sunt&nbsp;necesare pentru buna derulare a Contractului (completarea facturilor, documentelor contabile) i nu&nbsp;vor fi folosite n alte scopuri.&nbsp;</p><p>Datele personale obinute sunt procesate n bazele de date i pe serverele Niro Investment S.A. (societate afiliata), pe ntreaga durat a raporturilor contractuale i ulterior, conform politicilor&nbsp;interne, pe durata necesar ndeplinirii obligaiilor legale ce ii revin. Respectarea cerinelor legale&nbsp;aplicabile sunt permanent monitorizate, inclusiv prin Responsabilul de protecie a datelor cu caracter&nbsp;personal 