ntru semnarea Contractului&nbsp;i c Partea pe care o reprezint este valabil nregistrat i are deplin capacitate pentru ncheierea&nbsp;prezentului acord i pentru exercitarea drepturilor i executarea obligaiilor prevzute prin acesta. 13.3. Partile declara ca toate prevederile Contractului au fost negociate cu bunacredinta, le-au&nbsp;citit, si le-au asumat si sunt de acord cu acestea asa cum sunt consemnate prin prezentul inscris.&nbsp;13.4. Ambele Parti declara ca isi asuma, pe toata durata contractuala, riscul schimbarii&nbsp;imprejurarilor (de orice natura- inclusiv, dar fara a se limita la, cele politice, economice, comerciale si&nbsp;financiare) existente la data incheierii Contractului, cu respectarea prevederilor Art. 1271 Cod civil.&nbsp;13.5. Prezentul Contract este supus legii romane si interpretat in conformitate cu prevederile&nbsp;acesteia. Orice litigiu, controversa sau pretentie a Partilor, decurgand din sau in legatura cu prezentul&nbsp;Contract si care nu a fost solutionata de Parti in mod amiabil, va fi supusa, spre solutionare, instantelor&nbsp;judecatoresti competente din Bucuresti.&nbsp;</p><p>13.6. Contract poate fi modificat exclusiv prin incheierea de acte aditionale.&nbsp;13.7. Prevederile contractuale sunt integral obligatorii pentru Partile semnatare si succesorii lor in&nbsp;drepturi si obligatii.&nbsp;</p><p>Prezentul Contract a fost incheiat in 2 (dou) exemplare astazi, 01.02.2024, cate un exemplar pentru&nbsp;fiecare Parte.&nbsp;</p><p>Beneficiar, Prestator,&nbsp;</p><p><strong>NIRO INVESTMENT S.A. SOFTHUB AG S.R.L. </strong>Director General, Administrator,&nbsp;</p><p><strong>Mihaela Istrate Razvan Mihai Mustata</strong>&nbsp;</p>	72
