prezentul Contract.&nbsp;</p><p>Sunt considerate informaii confideniale i fac obiectul prezentelor clauze, datele de identificare&nbsp;(nume, semntur, serie i numr CI etc.) ale reprezentanilor Prilor, care se vor regsi pe&nbsp;documentele emise de (schimbate ntre) Pari n perioada derulrii Contractului i care nu sunt de&nbsp;domeniul public la momentul divulgrii. Prelucrarea de ctre Pri a datelor cu caracter personal ale&nbsp;persoanelor vizate mai sus se va realiza cu respectarea principiilor i drepturilor acestora care decurg&nbsp;din punerea n aplicare a REGULAMENTUL (UE) 2016/679 AL PARLAMENTULUI EUROPEAN I AL&nbsp;CONSILIULUI privind protecia persoanelor fizice n ceea ce privete prelucrarea datelor cu caracter&nbsp;personal  GDPR. n spiritul GDPR, Prile au urmtoarele drepturi de acces la datele personale ale&nbsp;angajailor/reprezentanilor proprii, operate de cealalt Parte:a) Dreptul de acces la date; b) reptul&nbsp;la rectificarea datelor; c) Dreptul la tergerea datelor; d)Dreptul la restricionarea prelucrrii; e)&nbsp;Dreptul la portabilitatea datelor; f) Dreptul de opoziie la prelucrarea datelor; g) Dreptul de a nu fi&nbsp;supus unor decizii automatizate, inclusiv profilarea; h) Dreptul la notificarea destinatarilor privind&nbsp;rectificarea, tergerea ori restricionarea datelor cu caracter personal.&nbsp;</p><p>Conform legislaiei naionale n vigoare n domeniu, datele personale solicitate de beneficiar sunt&nbsp;necesare pentru buna derulare a Contractului (completarea facturilor, documentelor contabile) i nu&nbsp;vor fi folosite n alte scopuri.&nbsp;</p><p>Datele personale obinute sunt procesate n bazele de date i pe serverele Niro Investment S.A. (societate afiliata), pe ntreaga durat a raporturilor contractuale i ulterior, conform politicilor&nbsp;interne, pe durata necesar ndeplinirii obligaiilor legale ce ii revin. Respectarea cerinelor legale&nbsp;aplicabile sunt permanent monitorizate, inclusiv prin Responsabilul de protecie a datelor cu caracter&nbsp;personal ce poate fi contactat la dpo@nirogroup.ro. Reclamaiile privind posibila nclcare a&nbsp;drepturilor privind prelucrarea datelor cu caracter personal pot fi adresate Autoritii Naionale de&nbsp;Supraveghere a Prelucrrii Datelor cu Caracter Personal la adresa www.dataprotection.ro.&nbsp;</p><p>Oricare dintre Prile contractante se oblig, n termenii i condiiile prezentului Contract, s pstreze&nbsp;strict confideniale, pe durata Contractului i dup incetarea acestuia, toate datele i informaiile,&nbsp;divulgate n orice manier de ctre cealalt Parte, n executarea Contractului. Excepie de la prezenta&nbsp;obligaie sunt cazurile n care divulgarea este necesar pentru executarea Contractului i se face&nbsp;numai avand consimmntul scris, expres si prealabil al celeilalte Pri sau daca divulgarea este&nbsp;solicitat, n mod legal, de ctre autoritile de drept.&nbsp;</p><p>n cazul n care oricare dintre Pri va nclca obligaia de confidenialitate, aceasta va fi obligat la&nbsp;plata de daune-interese n favoarea Prii prejudiciate.&nbsp;</p><p><strong>Art.12. Cesiunea Contractului&nbsp;</strong></p><p>12.1. Prezentul Contract are caracter <em>intuitu personae </em>in privinta Prestatorului; acesta nu poate&nbsp;transmite unei tere persoane, total sau parial, drepturile i obligaiile ce ii revin prin prezentul&nbsp;Contract, dect dac a obinut acordul scris i prealabil al Beneficiarului, care acord trebuie transmis&nbsp;Prestatorului n termen de 5 (cinci) zile lucrtoare de la momentul primirii notificrii. n lipsa unui&nbsp;</p><p>P a g e 6 | 6&nbsp;</p><p>rspuns scris i expres exprimat n acest sens, se consider c Partea nu consimte la cesiunea&nbsp;Contractului i aceasta nu poate avea loc.&nbsp;</p><p><strong>Art. 13. Clauze finale&nbsp;</strong></p><p>13.1. Partile sunt de drept in intarziere in cazul neindeplinirii sau indeplinirii necorespunzatoare a&nbsp;oricareia din obligatiile ce le revin potrivit Contractului.&nbsp;</p><p>13.2. Reprezentanii Prilor declar c sunt pe deplin mputerni