e calitate, deviz care va fi furnizat de catre Prestator Beneficiarului&nbsp;la data emiterii facturii fiscale.&nbsp;</p><p>5.3. Plata remuneraiei datorate Prestatorului se va face la finalizare Serviciilor, n termen de&nbsp;maximum 10 (zece) zile lucrtoare de la data acceptrii la plat a facturii fiscale emise de Prestator.&nbsp;</p><p>5.4. Plata se efectueaza n contul Prestatorului cod RO17INGB0000999906676339 deschis la ING&nbsp;BANK NV pe numele Prestatorului.&nbsp;</p><p>P a g e 3 | 6&nbsp;</p><p><strong>Art.6. Durata Contractului&nbsp;</strong></p><p>6.1. Contractul i produce efectele de la data semnrii prezentului inscris de ctre ambele Pri i&nbsp;este valabil pn la ndeplinirea tuturor obligaiilor contractuale.&nbsp;</p><p>6.2. Prestatorul se angajeaz ca, pn la data de <strong>20.02.2024</strong>, s finalizeze Serviciile la care se&nbsp;angajeaz prin prezentul Contract (<strong>Termen de finalizare</strong>)&nbsp;</p><p>6.3. Termenul de finalizare este ferm.&nbsp;</p><p>6.4. In cazul in care Prestatorul nu isi indeplineste corespunztor obligatiile asumate prin Contract,&nbsp;Beneficiarul este indreptatit sa perceapa penalitati de intarziere de 0,5% pe zi de intarziere, calculat&nbsp;din valoarea totala a Contractului. In cazul in care Beneficiarul nu onoreaza plata in termenii prevazui&nbsp;prin Contract, acesta are obligatia de a plati penalitati de intarziere de 0,5% pe zi de intarziere,&nbsp;calculat din suma datorat. Cuantumul penalitilor poate depi valoarea la care ele au fost calculate.&nbsp;</p><p><strong>Art.7. ncetarea Contractului&nbsp;</strong></p><p>7.1. Prezentul Contract nceteaz n oricare din urmtoarele modaliti:&nbsp;</p><p>(a) prin acordul scris al Prilor;&nbsp;</p><p>(b) prin ajungerea la termen i/sau ndeplinirea tuturor obligaiilor contractuale; (c) prin demararea procedurilor de faliment, dizolvare sau lichidare a oricreia dintre Pri; (d) n caz de fora major, n condiiile legii;&nbsp;</p><p>(e) prin denuntarea unilaterala a Contractului de catre Beneficiar, oricand, indiferent de motiv,&nbsp;transmitand Prestatorului o notificare prealabila cu minim 10 (zece) zile calendaristice nainte&nbsp;de data la care opereaz ncetarea Contractului;&nbsp;</p><p>(f) prin cesionarea de ctre Prestator a drepturile i obligaiilor sale prevzute prin Contract, fr&nbsp;acordul scris, expres i prealabil al Beneficiarului;&nbsp;</p><p>(g) prin rezilierea unilateral de ctre oricare dintre Pri, n baza unei notificri de reziliere&nbsp;transmis celeilalte Pri conform Art. 1.552 Codul Civil, n msura n care acesta nu&nbsp;ndeplinete sau ndeplinete n mod necorespunztor obligatiile sale i nu le remediaz n&nbsp;termenul indicat de catre cealalt Parte;&nbsp;</p><p>7.2. ncetarea Contractului nu va avea niciun efect asupra obligaiilor deja scadente ntre Pri la data&nbsp;survenirii acesteia.&nbsp;</p><p>7.3. Prestatorul se afla de drept in inatrziere odata cu implinirea Termenului de finalizare. 7.4. Decalarea termenelor de executie determina decalarea corespunzatoare a platilor.&nbsp;</p><p><strong>Art. 8. Forta majora&nbsp;</strong></p><p>8.1. Forta majora exonereaza de raspundere Partea care o invoca, dar numai in masura si pentru&nbsp;perioada in care Partea este impiedicata sau intarziata sa-si execute obligatia din pricina situatiei de&nbsp;forta majora. Partea care invoca forta majora va depune toate eforturile rezonabile pentru a reduce&nbsp;cat mai mult posibil efectele rezultand din forta majora.&nbsp;</p><p>8.2. Forta majora exonereaza de raspundere Partea care o invoca, in conditiile legii, daca o comunica&nbsp;in scris, celeilalte Parti in termen de 15 zile de la producere si o dovedeste printr-un certificat oficial,&nbsp;in termen de 15 de zile de la data invocarii ei.&nbsp;</p><p>8.3. Prin forta majora se inteleg toate evenimentele si/sau imprejurarile independente de vointa&nbsp;partii care invoca forta majora, imprevizibile si de neinlaturat si care, survenind dupa incheierea&nbsp;contractului, impiedica ori intirzie, total sau partial, indeplinirea obligatiilor izvorind din acest&nbsp;</p><p>P a g e 4 | 6&nbsp;</p><p>contract.&nbsp;</p><p>8.4. Pentru orice intarziere si/sau neindeplinire a obligatiilor contractuale de catre oricare din Parti&nbsp;ca urmare a situatiei de forta majora, niciuna din Parti nu va fi indreptatita sa pretinda celeilalte Parti&nbsp;penalitati, dobanzi, ori despagubiri care altfel ar fi fost platibile.&nbsp;</p><p>8.5. Daca, datorita situatiei de forta majora, una din Parti este impiedicata sa-si indeplineasca, total&nbsp;sau partial obligatiile sale contractuale pe o perioada mai mare 1 luna, atunci oricare Parte va avea&nbsp;dreptul, in lipsa unei alte intelegeri, sa rezilieze contractul, printr-o notificare scrisa adresata&nbsp;celeilalte Parti. In acesta situatie, Partile vor stabili consecintele rezilierii.&nbsp;</p><p><strong>Art. 9. Notificari, adrese, comunicari&nbsp;</strong></p><p>9.1. Orice adres, notificare, comunicare sau cerere fcut n legtur cu executarea prezentului&nbsp;Contract vor fi fcute n scris.&nbsp;</p><p>9.2. Orice adres, notificare, comunicare sau cerere este consider valabil fcut, dac va fi transmis&nbsp;celeilalte Pri la adresa menionat n prezentul Contract, prin pot, cu scrisoare recomandat cu&nbsp;confirmare de primire.&nbsp;</p><p>9.3. Toate aceste comunicri se pot face i prin fax, e-mail, cu condiia confirmrii n scris a primirii&nbsp;lor.&nbsp;</p><p>9.4. Toate notificrile i comunicrile privind prezentul Contract vor fi trimise la adresele mentionate&nbsp;in preambulul Contractului.&nbsp;</p><p>9.5. n cazul n care o Parte i schimb datele de contact, aceasta are obligaia de a notifica acest&nbsp;eveniment celeilalte Pri n termen de maxim 1 zi lucrtoare, calculat de la momentul producerii&nbsp;schimbrii, n caz contrar considerndu-se c scrisoarea/notificarea/cererea a fost trimis n mod&nbsp;valabil la datele cunoscute n momentul ncheierii Contractului.&nbsp;</p><p>9.6. Orice adresa, notificare, comunicare sau cerere transmis prin