uieli aferente unor elemente pe care legislaia romn le consider a fi de natur a reflecta&nbsp;natura dependent a unei activiti economice.&nbsp;</p><p>1.2. Pe durata prezentului Contract, Prestatorul va furniza Serviciile prevzute n Contract.&nbsp;</p><p>1.3. Prestatorul i va suporta propriile sale cheltuieli n interesul desfurrii activitii, precum orice&nbsp;tipuri de cheltuieli aferente:&nbsp;</p><p>a) deplasrii de la/la sediul Prilor sau al altor persoane fizice/juridice,&nbsp;</p><p>b) timpului de odihn, n care Parile nu-i execut prestaiile unele fa de altele, c) imposibilitii temporare de realizare a prestaiilor contractuale ca urmare a unui concediu&nbsp;medical sau oricror cauze asementoare,&nbsp;</p><p>d) oricror altor situaii de natura celor prevzute la alin. 1-3.&nbsp;</p><p>1.4. Serviciile vor fi prestate de Prestator din orice locatie adecvata, folosind baza materiala a&nbsp;Prestatorului (statie de lucru, conexiune internet, software specializat de dezvoltare, software&nbsp;specializat de testare etc.), iar livrabilele vor fi furnizate electronic Beneficiarului (prin email sau&nbsp;ncrcare pe serverele specializate ale Beneficiarului).&nbsp;</p><p><strong>Art. 2. Obiectul Contractului&nbsp;</strong></p><p>2.1. Prestatorul se obliga sa furnizeze, la solicitarea Beneficiarului si in beneficiul acestuia, servicii de&nbsp;integrare a sistemului <strong>Charisma </strong>cu platforma<strong>/</strong>aplicaia <strong>CEC Bank</strong>, pentru export extrase de cont i&nbsp;efectuare pli n sistem internet banking (<strong>Serviciile</strong>).</p><p>P a g e 2 | 6&nbsp;</p><p><strong>Art. 3. Obligatiile Prestatorului&nbsp;</strong></p><p>Prestatorul isi asuma urmatoarele obligatii:&nbsp;</p><p>a) sa presteze Serviciile catre Beneficiar conform solicitarilor acestuia si sa asigure&nbsp;finalizarea corespunzatoare si in timp util a acestora, la standardele de calitate cerute si&nbsp;in termenele agreate;&nbsp;</p><p>b) sa furnizeze Serviciile spre satisfactia rezonabila a Beneficiarului, Beneficiarul putand&nbsp;solicita Prestatorului sa rectifice orice Servicii care au fost prestate in mod&nbsp;necorespunzator;&nbsp;</p><p>c) pe toat perioada realizrii obligaiilor prezentului Contract, s comunice Beneficiarului,&nbsp;orice modificare cu privire la sediul social, denumire, divizare, fuziune;&nbsp;</p><p>d) s presteze Serviciile prin utilizarea doar a propriilor sale bunuri i/sau capitaluri (spaii&nbsp;de birouri/producie, echipamente, aparatur i oricare altele asemenea);&nbsp;</p><p>e) s presteze serviciile cu respectarea principiului independenei activitii desfurate de&nbsp;Prestator consfinit de dispoziiile art. 4 lit.a) din O.U.G. nr. 44/2008.&nbsp;</p><p><strong>Art.4. Obligatiile Beneficiarului&nbsp;</strong></p><p>Beneficiarul isi asuma urmatoarele obligatii:&nbsp;</p><p>a) n sensul Art. 3, lit. e), Partile inteleg si convin ca nu se afla si nici nu vor intra intr-o relatie&nbsp;de subordonare una fata de cealalta, fata de organele de conducere ale celeilalte Parti sau&nbsp;fata de alte entitati care detin controlul asupra/ sunt detinute de cealalta Parte;&nbsp;</p><p>b) sa puna la dispozitia Prestatorului informatiile solicitate de acesta, legate de activitatea&nbsp;Beneficiarului, care sunt necesare pentru buna executare a serviciilor asumate de&nbsp;Prestator;&nbsp;</p><p>c) sa plateasca Prestatorului, in termenii stabiliti prin prezentul Contract, pretul prevazut&nbsp;pentru Serviciile prestate, pe baza facturii emise de Prestator, insotita de devizul de lucru,&nbsp;aprobat de Beneficiar.&nbsp;</p><p><strong>Art. 5. Pretul Contractului i modalitatea de plat&nbsp;</strong></p><p>5.1. n schimbul Serviciilor prestate, Beneficiarul se obliga sa plateasca Prestatorului remuneratia&nbsp;datorat n cuantum de <strong>800(optsute) Euro</strong>. Prestatorul nu este pltitor de TVA.&nbsp;</p><p>5.2. Plata Serviciilor se va face in baza unui deviz agreat de ambele Parti care atesta serviciile&nbsp;efectuate, durata lor si termenii de calitate, deviz care va fi furnizat de catre Prestator Beneficiarului&nbsp;la data emiterii facturii fiscale.&nbsp;</p><p>5.3. Plata remuneraiei datorate Prestatorului se va face la finalizare Serviciilor, n termen de&nbsp;maximum 10 (zece) zile lucrtoare de la data acceptrii la plat a facturii fiscale emise de Prestator.&nbsp;</p><p>5.4. Plata se efectueaza n contul Prestatorului cod RO17INGB0000999906676339 deschis la ING&nbsp;BANK NV pe numele Prestatorului.&nbsp;</p><p>P a g e 3 | 6&nbsp;</p><p><strong>Art.6. Durata Contractului&nbsp;</strong></p><p>6.1. Contractul i produce efectele de la data semnrii prezentului inscris de ctre ambele Pri i&nbsp;este valabil pn la ndeplinirea tuturor obligaiilor contractuale.&nbsp;</p><p>6.2. Prestatorul se angajeaz ca, pn la data de <strong>20.02.2024</strong>, s finalizeze Serviciile la care se&nbsp;angajeaz prin prezentul Contract (<strong>Termen de finalizare</strong>)&nbsp;</p><p>6.3. Termenul de finalizare este ferm.&nbsp;</p><p>6.4. In cazul in care Prestatorul nu isi indeplineste corespunztor obligatiile asumate prin Contract,&nbsp;Beneficiarul este indreptatit sa perceapa penalitati de intarziere de 0,5% pe zi de intarziere, calculat&nbsp;din valoarea totala a Contractului. In cazul in care Beneficiarul nu onoreaza plata in termenii prevazui&nbsp;prin Contract, acesta are obligatia de a plati penalitati de intarziere de 0,5% pe zi de intarziere,&nbsp;calculat din suma datorat. Cuantumul penalitilor poate depi valoarea la care ele au fost calculate.&nbsp;</p><p><strong>Art.7. ncetarea Contractului&nbsp;</strong></p><p>7.1. Prezentul Contract nceteaz n oricare din urmtoarele modaliti:&nbsp;</p><p>(a) prin acordul scris al Prilor;&nbsp;</p><p>(b) prin ajungerea la termen i/sau ndeplinirea tuturor obligaiilor contractuale; (c) prin demararea procedurilor de faliment, dizolvare sau lichidare a oricreia dintre Pri; (d) n caz de fora major, n condiiile legii;&nbsp;</p><p>(e) prin denuntarea unilaterala a Contractului de catre Beneficiar, oricand, indiferent de motiv,&nbsp;transmitand Prestatorului o notificare prealabila cu minim 10 (zece) zile calendaristice nainte&nbsp;de data la care opereaz ncetarea Contractului;&nbsp;</p><p>(f) prin cesionarea de ctre Prestator a drepturile i obligaiilor sale prevzute prin Contract, fr&nbsp;acordul scris, expres i prealabil al Beneficiarului;&nbsp;</p><p>(g) prin rezilierea unilateral de ctre oricare dintre Pri, n baza unei notificri de reziliere&nbsp;transmis celeilalte Pri conform Art. 1.552 Codul Civil, n msura n care acesta nu&nbsp;ndeplinete sau ndeplinete n mod necorespunztor obligatiile sale i nu le remediaz n&nbsp;termenul indicat de catre cealalt Parte;&nbsp;</p><p>7.2. ncetarea Contractului nu va avea niciun efect asupra obligaiilor deja scadente ntre Pri la data&nbsp;survenirii acesteia.&nbsp;</p><p>7.3. Prestatorul se afla de drept in inatrziere odata cu implinirea Termenului de finalizare. 7.4. Decalarea termenelor de executie determina decalarea corespunzatoare a platilor.&nbsp;</p><p><strong>Art. 8. Forta majora&nbsp;</strong></p><p>8.1. Forta majora exonereaza de raspundere Partea care o invoca, dar numai in masura si pentru&nbsp;perioada in care Partea este impiedicata sau intarziata sa-si execute obligatia din pricina situatiei de&nbsp;forta majora. Partea care invoca forta majora va depune toate eforturile rezonabile pentru a reduce&nbsp;cat mai mult posibil efectele rezultand din forta majora.&nbsp;</p><p>8.2. Forta majora exonereaza de raspundere Partea care o invoca, in conditiile legii, daca o comunica&nbsp;in scris, celeilalte Parti in termen de 15 zile de la producere si o dovedeste printr-un certificat oficial,&nbsp;in termen de 15 de zile de la data invocarii ei.&nbsp;</p><p>8.3. Prin forta majora se inteleg toate evenimentele si/sau imprejurarile independente de vointa&nbsp;partii care invoca forta majora, imprevizibile si de neinlaturat si care, survenind dupa incheierea&nbsp;contractului, impiedica ori intirzie, total sau partial, indeplinirea obligatiilor izvorind din acest&nbsp;</p><p>P a g e 4 | 6&nbsp;</p><p>contract.&nbsp;</p><p>8.4. Pentru orice intarziere si/sau neindeplinire a obligatiilor contractuale de catre oricare din Parti&nbsp;ca urmare a situatiei de forta majora, niciuna din Parti nu va fi indreptatita sa pretinda celeilalte Parti&nbsp;penalitati, dobanzi, ori despagubiri care altfel ar fi fost platibile.&nbsp;</p><p>8.5. Daca, datorita situatiei de forta majora, una din Parti este impiedicata sa-si indeplineasca, total&nbsp;sau partial obligatiile sale contractuale pe o perioada mai mare 1 luna, atunci oricare Parte va avea&nbsp;dreptul, in lipsa unei alte intelegeri, sa rezilieze contractul, printr-o notificare scrisa adresata&nbsp;celeilalte Parti. In acesta situatie, Partile vor stabili consecintele rezilierii.&nbsp;</p><p><strong>Art. 9. Notificari, adrese, comunicari&nbsp;</strong></p><p>9.1. Orice adres, notificare, comunicare sau cerere fcut n legtur cu executarea prezentului&nbsp;Contract vor fi fcute n scris.&nbsp;</p><p>9.2. Orice adres, notificare, comunicare sau cerere este consider valabil fcut, dac va fi transmis&nbsp;celeilalte Pri la adresa menionat n prezentul Contract, prin pot, cu scrisoare recomandat cu&nbsp;confirmare de primire.&nbsp;</p><p>9.3. Toate aceste comunicri se pot face i prin fax, e-mail, cu condiia confirmrii n scris a primirii&nbsp;lor.&nbsp;</p><p>9.4. Toate notificrile i comunicrile privind prezentul Contract vor fi trimise la adresele mentionate&nbsp;in preambulul Contractului.&nbsp;</p><p>9.5. n cazul n care o Parte i schimb datele de contact, aceasta are obligaia de a notifica acest&nbsp;eveniment celeilalte Pri n termen de maxim 1 zi lucrtoare, calculat de la momentul producerii&nbsp;schimbrii, n caz contrar considerndu-se c scrisoarea/notificarea/cererea a fost trimis n mod&nbsp;valabil la datele cunoscute n momentul ncheierii Contractului.&nbsp;</p><p>9.6. Orice adresa, notificare, comunicare sau cerere transmis prin fax/e-mail se va considera ca fiind&nbsp;trimis n prima zi lucrtoare dup cea n care a fost expediat;&nbsp;</p><p>9.7. Data la care se va considera primit o notificare/adresa/cerere/comunicare este data menionat&nbsp;n raportul de confirmare.&nbsp;</p><p><strong>Art. 10. Litigii&nbsp;</strong></p><p>10.1. Prezentul Contract este guvernat de legea romn.&nbsp;</p><p>10.2. Orice nenelegere rezultat din valabilitatea, executarea i interpretarea prezentului Contract&nbsp;va fi soluionat n mod amiabil. Cnd aceasta nu este posibil, litigiul va fi depus spre soluionare&nbsp;instantelor competente de la sediul Beneficiarului.&nbsp;</p><p><strong>Art.11. CLAUZA DE CONFIDENIALITATE SI DE PROTECTIE A DATELOR PERSONALE (GDPR).&nbsp;</strong></p><p>Fiecare Parte se oblig s nu divulge terelor persoane, fr acordul prealabil exprimat n scris al&nbsp;celeilalte Pari, informaia obinut n procesul executrii prezentului Contract, precum i s o&nbsp;utilizeze numai n scopurile executrii prezentului Contract. Obligaia nu se aplic informaiei: a.&nbsp;divulgate la solicitarea unor autoritati publice cu atributii, fcut n conformitate cu legislaia n&nbsp;vigoare; b. care este de domeniul public la momentul divulgrii; c. divulgate n cadrul unui proces&nbsp;judiciar ntre Pari privind acest Contract; d. divulgate acionarilor Prii, persoanelor cu funcii de&nbsp;rspundere, salariailor, reprezentanilor, agenilor, consultanilor, auditorilor, cedenilor,&nbsp;</p><p>P a g e 5 | 6&nbsp;</p><p>succesorilor i/sau ntreprinderilor afiliate ale Parii care sunt implicate n executarea prezentului&nbsp;Contract, referitor la care Partea va trebui:- s limiteze divulgarea informaiei numai ctre cei ce au&nbsp;nevoie de ea pentru ndeplinirea obligaiilor sale fa de Parte;- sa asigure folosirea informaiei&nbsp;exclusiv in scopurile nemijlocit legate de ceea pentru ce informaia este divulgata;- sa informeze toate&nbsp;aceste persoane privind obligaia lor de a pstra confidenialitatea informaiei n modul stabilit de prezentul Contract.&nbsp;</p><p>Sunt considerate informaii confideniale i fac obiectul prezentelor clauze, datele de identificare&nbsp;(nume, semntur, serie i numr CI etc.) ale reprezentanilor Prilor, care se vor regsi pe&nbsp;documentele emise de (schimbate ntre) Pari n perioada derulrii Contractului i care nu sunt de&nbsp;domeniul public la momentul divulgrii. Prelucrarea de ctre Pri a datelor cu caracter personal ale&nbsp;persoanelor vizate mai sus se va realiza cu respectarea principiilor i drepturilor acestora care decurg&nbsp;din punerea n aplicare a REGULAMENTUL (UE) 2016/679 AL PARLAMENTULUI EUROPEAN I AL&nbsp;CONSILIULUI privind protecia persoanelor fizice n ceea ce privete prelucrarea datelor cu caracter&nbsp;personal  GDPR. n spiritul GDPR, Prile au urmtoarele drepturi de acces la datele personale ale&nbsp;angajailor/reprezentanilor proprii, operate de cealalt Parte:a) Dreptul de acces la date; b) reptul&nbsp;la rectificarea datelor; c) Dreptul la tergerea datelor; d)Dreptul la restricionarea prelucrrii; e)&nbsp;Dreptul la portabilitatea datelor; f) Dreptul de opoziie la prelucrarea datelor; g) Dreptul de a nu fi&nbsp;supus unor decizii automatizate, inclusiv profilarea; h) Dreptul la notificarea destinatarilor privind&nbsp;rectificarea, tergerea ori restricionarea datelor cu caracter personal.&nbsp;</p><p>Conform legislaiei naionale n vigoare n domeniu, datele personale solicitate de beneficiar sunt&nbsp;necesare pentru buna derulare a Contractului (completarea facturilor, documentelor contabile) i nu&nbsp;vor fi folosite n alte scopuri.&nbsp;</p><p>Datele personale obinute sunt procesate n bazele de date i pe serverele Niro Investment S.A. (societate afiliata), pe ntreaga durat a raporturilor contractuale i ulterior, conform politicilor&nbsp;interne, pe durata necesar ndeplinirii obligaiilor legale ce ii revin. Respectarea cerinelor legale&nbsp;aplicabile sunt permanent monitorizate, inclusiv prin Responsabilul de protecie a datelor cu caracter&nbsp;personal ce poate fi contactat la dpo@nirogroup.ro. Reclamaiile privind posibila nclcare a&nbsp;drepturilor privind prelucrarea datelor cu caracter personal pot fi adresate Autoritii Naionale de&nbsp;Supraveghere a Prelucrrii Datelor cu Caracter Personal la adresa www.dataprotection.ro.&nbsp;</p><p>Oricare dintre Prile contractante se oblig, n termenii i condiiile prezentului Contract, s pstreze&nbsp;strict confideniale, pe durata Contractului i dup incetarea acestuia, toate datele i informaiile,&nbsp;divulgate n orice manier de ctre cealalt Parte, n executarea Contractului. Excepie de la prezenta&nbsp;obligaie sunt cazurile n care divulgarea este necesar pentru executarea Contractului i se face&nbsp;numai avand consimmntul scris, expres si prealabil al celeilalte Pri sau daca divulgarea este&nbsp;solicitat, n mod legal, de ctre autoritile de drept.&nbsp;</p><p>n cazul n care oricare dintre Pri va nclca obligaia de confidenialitate, aceasta va fi obligat la&nbsp;plata de daune-interese n favoarea Prii prejudiciate.&nbsp;</p><p><strong>Art.12. Cesiunea Contractului&nbsp;</strong></p><p>12.1. Prezentul Contract are caracter <em>intuitu personae </em>in privinta Prestatorului; acesta nu poate&nbsp;transmite unei tere persoane, total sau parial, drepturile i obligaiile ce ii revin prin prezentul&nbsp;Contract, dect dac a obinut acordul scris i prealabil al Beneficiarului, care acord trebuie transmis&nbsp;Prestatorului n termen de 5 (cinci) zile lucrtoare de la momentul primirii notificrii. n lipsa unui&nbsp;</p><p>P a g e 6 | 6&nbsp;</p><p>rspuns scris i expres exprimat n acest sens, se consider c Partea nu consimte la cesiunea&nbsp;Contractului i aceasta nu poate avea loc.&nbsp;</p><p><strong>Art. 13. Clauze finale&nbsp;</strong></p><p>13.1. Partile sunt de drept in intarziere in cazul neindeplinirii sau indeplinirii necorespunzatoare a&nbsp;oricareia din obligatiile ce le revin potrivit Contractului.&nbsp;</p><p>13.2. Reprezentanii Prilor declar c sunt pe deplin mputernicii pentru semnarea Contractului&nbsp;i c Partea pe care o reprezint este valabil nregistrat i are deplin capacitate pentru ncheierea&nbsp;prezentului acord i pentru exercitarea drepturilor i executarea obligaiilor prevzute prin acesta. 13.3. Partile declara ca toate prevederile Contractului au fost negociate cu bunacredinta, le-au&nbsp;citit, si le-au asumat si sunt de acord cu acestea asa cum sunt consemnate prin prezentul inscris.&nbsp;13.4. Ambele Parti declara ca isi asuma, pe toata durata contractuala, riscul schimbarii&nbsp;imprejurarilor (de orice natura- inclusiv, dar fara a se limita la, cele politice, economice, comerciale si&nbsp;financiare) existente la data incheierii Contractului, cu respectarea prevederilor Art. 1271 Cod civil.&nbsp;13.5. Prezentul Contract este supus legii romane si interpretat in conformitate cu prevederile&nbsp;acesteia. Orice litigiu, controversa sau pretentie a Partilor, decurgand din sau in legatura cu prezentul&nbsp;Contract si care nu a fost solutionata de Parti in mod amiabil, va fi supusa, spre solutionare, instantelor&nbsp;judecatoresti competente din Bucuresti.&nbsp;</p><p>13.6. Contract poate fi modificat exclusiv prin incheierea de acte aditionale.&nbsp;13.7. Prevederile contractuale sunt integral obligatorii pentru Partile semnatare si succesorii lor in&nbsp;drepturi si obligatii.&nbsp;</p><p>Prezentul Contract a fost incheiat in 2 (dou) exemplare astazi, 01.02.2024, cate un exemplar pentru&nbsp;fiecare Parte.&nbsp;</p><p>Beneficiar, Prestator,&nbsp;</p><p><strong>NIRO INVESTMENT S.A. SOFTHUB AG S.R.L. </strong>Director General, Administrator,&nbsp;</p><p><strong>Mihaela Istrate Razvan Mihai Mustata</strong>&nbsp;</p>	100
