ATORULUI contravaloarea mrfii n condiiile prevzute la pct.4.</p><p>6.2. S asigure depozitarea, manipularea produselor n condiiile prevzute n specificaia tehnic primita de la VNZATOR.</p><p><strong>8. FORTA MAJORA&nbsp;</strong></p><p>8.1. Fora major exonereaz de rspundere partea care o invoca n condiiile legii, cu cerina notificrii scrise prealabil n termen de 7 zile de la apariia cazului de fora majora.&nbsp;</p><p><strong>9.LITIGII&nbsp;</strong></p><p>9.1. Eventualele litigii n derularea prezentului contract vor fi rezolvate pe cale amiabila.</p><p>n situaia n care acest lucru nu este posibil, litigiul va fi supus arbitrajului Camerei de Comer i Industrie a Romniei sau va fi soluionat potrivit normelor de drept comun.&nbsp;</p><p><strong>10. DISPOZITII FINALE&nbsp;</strong></p><p>10.1. Modificarea termenilor prezentului contract de ctre ambele pri este posibil numai prin act adiional.&nbsp;</p><p>10.2. ANEXA nr.1 face parte din prezentul contract de vnzare-cumprare.</p><p>10.3. Contractul poate fi reziliat numai cu acordul scris al ambelor pri.</p><p>10.4. Contractul intra n vigoare de la data semnrii sale de ctre VANZATOR i CUMPARATOR.</p><p>10.5. Prezentul contract s-a ncheiat azi _____________ , n doua exemplare, cate unul pentru fiecare parte contractanta, ambele cu valoare de original.</p><p><br></p><p>VNZATOR CUMPRTOR,</p><p>S.C. _____________________________\tS.C. _____________________________&nbsp;</p><p>Director/Administrator _________________Director,/Administrator _______________________</p><p>Semntura : Semntura</p><p><br></p><p>Data semnrii: ____________ Data semnrii: ____________&nbsp;</p><p><br></p><p><br></p><p><br></p><p><br></p><p><strong>ANEXA NR.1 LA CONTRACTUL DE VANZARE-CUMPARARE NR. _____ / ___________&nbsp;</strong></p><p>1. SPECIFICATIA CONTRACTULUI  XXXXXXXXXXX&nbsp;</p><p>2.CANTITATEA  ___ buc/kg. ________________________&nbsp;</p><p>3.PRET UNITAR  ______________ EURO, fr TVA pentru _________________________. </p><p>4.VALOAREA CONTRACTU